import { useEffect,useState } from "react";
import { CartState } from "../context/Context";

const Cart = () => {
  const { cart, getCart } = CartState();

  const [loading, setLoading] = useState(true);

  useEffect(() => {
    (async () => {
      try {
        await getCart();
      } catch (err) {
        console.warn(err);
      } finally {
        setLoading(false);
      }
    })();
  }, []);

  return <div> ({cart ? cart.map(products=><div>{products.name}</div>) : null})</div>;
};

export default Cart;
